import React, { useEffect } from "react";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import { PageContainer, Title } from "./styles/solution_style.js";

function Solution() {
  const windyUrl =
    "https://tiles.windy.com/tiles/v9.0/darkmap/{z}/{x}/{y}.png?key={your-api-key}";

  return (
    <MapContainer center={[39.1, -76.1]} zoom={10}>
      <TileLayer
        url={windyUrl}
        maxZoom={18}
        attribution='Map data &copy; <a href="https://www.windy.com">Windy.com</a>'
      />
    </MapContainer>
  );
}

export default Solution;
